"use strict";(self.webpackChunk_5_kdk_blog=self.webpackChunk_5_kdk_blog||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2023/07/04/useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c","metadata":{"permalink":"/blog/2023/07/04/useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c","editUrl":"https://github.com/5kdk/5kdk.github.io/tree/main/blog/2023-07-04-useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c.md","source":"@site/blog/2023-07-04-useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c.md","title":"useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c?","description":"useCallback\uacfc useMemo\ub294 \ub9ac\uc561\ud2b8\uc758 \ucd5c\uc801\ud654\ub97c \ub3c4\uc640\uc8fc\ub294 Hook\ub4e4\uc785\ub2c8\ub2e4. \uc131\ub2a5 \uac1c\uc120\uc744 \uc704\ud574 \uc0ac\uc6a9\ub418\uc9c0\ub9cc, \uaf2d \ud544\uc694\ud55c \uacbd\uc6b0\uc5d0\ub9cc \uc0ac\uc6a9\ud558\ub294 \uac83\uc774 \uc88b\uc2b5\ub2c8\ub2e4.","date":"2023-07-04T00:00:00.000Z","formattedDate":"2023\ub144 7\uc6d4 4\uc77c","tags":[{"label":"React","permalink":"/blog/tags/react"}],"readingTime":5.625,"hasTruncateMarker":true,"authors":[{"name":"Dongkyu Kim","title":"Collaborative FE developer","url":"https://github.com/5kdk","imageURL":"https://github.com/5kdk.png","key":"5kdk"}],"frontMatter":{"title":"useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c?","authors":"5kdk","tags":["React"],"enableComments":true},"nextItem":{"title":"useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \ub4a4\ub85c\uac00\uae30 \uc0ac\uc6a9\uc131 \uac1c\uc120","permalink":"/blog/2023/06/17/useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \uc0ac\uc6a9\uc131 \uac1c\uc120"}},"content":"`useCallback`\uacfc `useMemo`\ub294 \ub9ac\uc561\ud2b8\uc758 \ucd5c\uc801\ud654\ub97c \ub3c4\uc640\uc8fc\ub294 Hook\ub4e4\uc785\ub2c8\ub2e4. \uc131\ub2a5 \uac1c\uc120\uc744 \uc704\ud574 \uc0ac\uc6a9\ub418\uc9c0\ub9cc, \uaf2d \ud544\uc694\ud55c \uacbd\uc6b0\uc5d0\ub9cc \uc0ac\uc6a9\ud558\ub294 \uac83\uc774 \uc88b\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n> **useCallback**\\r\\n>\\r\\n> `useCallback`\uc740 \uc774\ubca4\ud2b8 \ud578\ub4e4\ub7ec\uc640 \uac19\uc740 \ud568\uc218\ub97c \uba54\ubaa8\uc774\uc81c\uc774\uc158(memorization)\ud560 \ub54c \uc0ac\uc6a9\ub418\ub294 Hook\uc785\ub2c8\ub2e4. \ucef4\ud3ec\ub10c\ud2b8\uac00 \ub9ac\ub80c\ub354\ub9c1\ub420 \ub54c\ub9c8\ub2e4 \ud568\uc218\ub97c \uc0c8\ub85c \uc0dd\uc131\ud558\ub294 \uac83\uc744 \ubc29\uc9c0\ud558\uace0, \uc774\uc804\uc5d0 \uc0dd\uc131\ud55c \ud568\uc218\ub97c \uc7ac\uc0ac\uc6a9\ud558\uc5ec \ubd88\ud544\uc694\ud55c \ub80c\ub354\ub9c1\uc744 \uc904\uc5ec\uc90d\ub2c8\ub2e4.\\r\\n\\r\\n> **useMemo**\\r\\n>\\r\\n> `useMemo`\ub294 \ub80c\ub354\ub9c1 \uc911\uc5d0 \ubc1c\uc0dd\ud558\ub294 \uc5f0\uc0b0\ub7c9\uc774 \ud070 \ud568\uc218\uc758 \uacb0\uacfc\uac12\uc744 \uba54\ubaa8\uc774\uc81c\uc774\uc158\ud558\uba70, \uc774\uc804 \uacb0\uacfc\uac12\uc744 \uc7ac\uc0ac\uc6a9\ud560 \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc90d\ub2c8\ub2e4.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n## \ub0a8\uc6a9\ud558\uc9c0 \ub9d0\uc544\uc57c\ud560 \uc774\uc720\\r\\n\\r\\n`useCallback`\uacfc `useMemo`\ub294 \uc131\ub2a5 \ucd5c\uc801\ud654\uc758 \ubaa9\uc801\uc73c\ub85c \uc0ac\uc6a9\ub418\uae34 \ud558\uc9c0\ub9cc, \ubb34\ubd84\ubcc4\ud558\uac8c \uc0ac\uc6a9\ud560 \uacbd\uc6b0 \uc624\ud788\ub824 \uc131\ub2a5 \uc800\ud558\ub97c \ucd08\ub798\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n1. **\uba54\ubaa8\uc774\uc81c\uc774\uc158 \uc790\uccb4\uc758 \ube44\uc6a9**: \uc774 \ub450 Hook\uc744 \uc0ac\uc6a9\ud558\uba74 \ud568\uc218\uc640 \uacc4\uc0b0 \uacb0\uacfc\ub97c \uce90\uc2f1\ud558\uae30 \uc704\ud55c \uba54\ubaa8\ub9ac \uc0ac\uc6a9\ub7c9\uc774 \ub298\uc5b4\ub0a9\ub2c8\ub2e4. \uac8c\ub2e4\uac00, \uc0c8\ub86d\uac8c \uacc4\uc0b0\ub418\ub294 \uac12\uc774 \uc77c\uc815 \uae30\uac04\ub3d9\uc548 \uc0ac\uc6a9\ub418\uc9c0 \uc54a\uc544\ub3c4 \uba54\ubaa8\ub9ac\uc5d0 \ub0a8\uc544 \uc788\uc5b4\uc57c \ud558\ubbc0\ub85c \uba54\ubaa8\ub9ac \uad00\ub9ac\uc758 \uce21\uba74\uc5d0\uc11c \ube44\ud6a8\uc728\uc801\uc77c \uc218 \uc788\uc2b5\ub2c8\ub2e4.(\uac00\ube44\uc9c0 \uceec\ub809\ud130\uac00 \ubb34\uc2dc)\\r\\n2. **\uc758\uc874\uc131 \ubc30\uc5f4\uc758 \uad00\ub9ac**: `useCallback`\uacfc `useMemo`\ub294 \uc758\uc874\uc131 \ubc30\uc5f4\uc774 \ud544\uc694\ud55c\ub370, \uc774 \ubc30\uc5f4\uc5d0 \ub4e4\uc5b4\uac04 \uac12\ub4e4\uc774 \ubcc0\uacbd\ub420 \ub54c\ub9c8\ub2e4 \uba54\ubaa8\uc774\uc81c\uc774\uc158\ub41c \uac12\uc744 \ubb34\ud6a8\ud654\ud558\uace0 \uc0c8\ub85c \uacc4\uc0b0\ud569\ub2c8\ub2e4. \uc774 \uacfc\uc815\uc5d0\uc11c \ubcf5\uc7a1\uc131\uc774 \uc99d\uac00\ud558\uba70, \uad00\ub9ac\uac00 \ubbf8\ud761\ud55c \uacbd\uc6b0 \uc624\ud788\ub824 \uc131\ub2a5\uc774 \uc800\ud558\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n3. **\ub0a8\uc6a9\uc5d0 \ub530\ub978 \uc2e4\uc218**: \ubb34\ubd84\ubcc4\ud55c \uc0ac\uc6a9\uc73c\ub85c \uc778\ud574 \ubaa8\ub4e0 \ud568\uc218\ub098 \uacb0\uacfc\uac12\uc744 \uba54\ubaa8\uc774\uc81c\uc774\uc158\ud558\ub824 \ud560 \ub54c \uc2e4\uc218\uac00 \ubc1c\uc0dd\ud560 \uac00\ub2a5\uc131\uc774 \ub192\uc544\uc9d1\ub2c8\ub2e4. \uc774\ub85c \uc778\ud574 \uc131\ub2a5 \ucd5c\uc801\ud654\ub97c \uae30\ub300\ud558\ub294 \ub300\uc2e0 \ubc84\uadf8\ub098 \uc131\ub2a5 \uc800\ud558\ub97c \ucd08\ub798\ud560 \uc218 \uc788\ub294 \uc0c1\ud669\uc774 \uc0dd\uae38 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n## useCallback\uacfc useMemo\ub97c \uc0ac\uc6a9\ud558\uae30 \uc88b\uc740 \uc0c1\ud669\\r\\n\\r\\n### \uc608\uc2dc 1: `useCallback`\uc744 \ud65c\uc6a9\ud55c \uc758\uc874\uc131 \ubc30\uc5f4\uc758 \ud568\uc218 \ucc38\uc870\\r\\n\\r\\n:::warn\\r\\n\uc544\ub798 \uc774\uc5b4\uc9c0\ub294 \ucf54\ub4dc\ub294 \uc608\uc2dc\uc5d0 \ub300\ud55c \uc774\ud574\ub97c \ub3d5\uae30\uc704\ud574 \uc791\uc131\ub41c \ud83d\udca9 \ucf54\ub4dc\uc785\ub2c8\ub2e4. \uc774\uc810 \ucc38\uace0\ubc14\ub78d\ub2c8\ub2e4.\\r\\n:::\\r\\n\\r\\n```jsx\\r\\nimport { useState, useCallback } from \'react\';\\r\\n\\r\\nconst ExpensiveCalculationButton = ({ onClick }) => {\\r\\n  const [count, setCount] = useState(0);\\r\\n\\r\\n  const handleClick = useCallback(() => {\\r\\n    onClick();\\r\\n    setCount(prevCount => prevCount + 1);\\r\\n  }, [onClick]);\\r\\n\\r\\n  return (\\r\\n    <button type=\\"button\\" onClick={handleClick}>\\r\\n      \ud074\ub9ad\ud69f\uc218: {count}\\r\\n    </button>\\r\\n  );\\r\\n};\\r\\n\\r\\nconst App = () => {\\r\\n  const [result, setResult] = useState(0);\\r\\n  const onClick = useCallback(\\r\\n    () => setResult(prevResult => prevResult + 1),\\r\\n    []\\r\\n  );\\r\\n\\r\\n  return (\\r\\n    <div>\\r\\n      <ExpensiveCalculationButton onClick={onClick} />\\r\\n      \uacb0\uacfc\uac12: {result}\\r\\n    </div>\\r\\n  );\\r\\n};\\r\\n\\r\\nexport default App;\\r\\n```\\r\\n\\r\\n`useCallback`\uc744 \uc0ac\uc6a9\ud574 `handleClick`\uc758 `onClick` \uc18d\uc131\uacfc \uad00\ub828\ub41c \ub3d9\uc77c\ud55c \ucc38\uc870\uac12\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 \ubd88\ud544\uc694\ud55c \ub80c\ub354\ub9c1\uc744 \ubc29\uc9c0\ud569\ub2c8\ub2e4.\\r\\n:::info\\r\\n\\r\\n\ud568\uc218\ub294 \uac1d\uccb4 \uc785\ub2c8\ub2e4!\\r\\n\\r\\n```js\\r\\nconst a = \'a\';\\r\\nconst a2 = \'a\';\\r\\n\\r\\na === a2; // true\\r\\n\\r\\nconst f = () => console.log(f);\\r\\nconst f2 = () => console.log(f);\\r\\n\\r\\nf === f2; // false\\r\\n```\\r\\n\\r\\n:::\\r\\n\\r\\n### \uc608\uc2dc 2: \ubcf5\uc7a1\ud55c \uacc4\uc0b0\uc5d0\uc11c\uc758 `useMemo`\\r\\n\\r\\n```jsx\\r\\nimport { useState, useMemo } from \'react\';\\r\\n\\r\\nconst expensiveCalculation = (a, b) => {\\r\\n  // \uae38\uace0 \ubcf5\uc7a1\ud55c \ucf54\ub4dc\u2026\\r\\n  return a * b;\\r\\n};\\r\\n\\r\\nconst Calculator = ({ a, b }) => {\\r\\n  const result = useMemo(() => expensiveCalculation(a, b), [a, b]);\\r\\n\\r\\n  return <div>\uacb0\uacfc\uac12: {result}</div>;\\r\\n};\\r\\n\\r\\nconst App = () => {\\r\\n  const [a, setA] = useState(5);\\r\\n  const [b, setB] = useState(10);\\r\\n\\r\\n  return (\\r\\n    <div>\\r\\n      <input\\r\\n        type=\\"number\\"\\r\\n        value={a}\\r\\n        onChange={e => setA(parseInt(e.target.value))}\\r\\n      />\\r\\n      <input\\r\\n        type=\\"number\\"\\r\\n        value={b}\\r\\n        onChange={e => setB(parseInt(e.target.value))}\\r\\n      />\\r\\n      <Calculator a={a} b={b} />\\r\\n    </div>\\r\\n  );\\r\\n};\\r\\n\\r\\nexport default App;\\r\\n```\\r\\n\\r\\n\uac12\uc744 \uc785\ub825\ud558\ub294 \uc785\ub825\ub780\uc758 \ubcc0\ud654\uc5d0 \ub530\ub77c `a`\uc640 `b` \uac12\uc774 \ubcc0\uacbd\ub418\uace0 `expensiveCalculation`\uc774 \uc2e4\ud589\ub429\ub2c8\ub2e4.\\r\\n\\r\\n`useMemo`\ub97c \uc0ac\uc6a9\ud558\uc5ec `a`\uc640 `b`\uac00 \uc2e4\uc81c\ub85c \ubcc0\uacbd\ub420 \ub54c\ub9cc \uacc4\uc0b0\uc744 \uc2e4\ud589\ud558\uace0, \uc774\uc804 \uacb0\uacfc\ub97c \uce90\uc2dc\ud558\uc5ec \ubd88\ud544\uc694\ud55c \uc5f0\uc0b0\uc744 \ubc29\uc9c0\ud569\ub2c8\ub2e4.(`a`\uc640 `b`\ub97c \uc758\uc874\uc131 \ubc30\uc5f4\uc5d0 \ud3ec\ud568\ud558\uc5ec \ubcc0\uacbd\ub418\ub294 \uacbd\uc6b0\uc5d0\ub9cc `expensiveCalculation`\uc744 \ud638\ucd9c)\\r\\n\\r\\n## \uacb0\ub860\\r\\n\\r\\n> \ubaa8\ub4e0 \ucd94\uc0c1\ud654(\ubc0f \uc131\ub2a5 \ucd5c\uc801\ud654)\uc5d0\ub294 \ube44\uc6a9\uc774 \ub530\ub978\ub2e4.\\r\\n\\r\\n`useCallback`\uacfc `useMemo`\ub294 \uc2e0\uc911\ud558\uac8c \uc0ac\uc6a9\ub418\uc5b4\uc57c \ud558\uace0, \ud544\uc694\ud55c \uacbd\uc6b0\uc5d0\ub9cc \uc801\uc6a9\ud558\uc5ec \uc131\ub2a5 \ucd5c\uc801\ud654\ub97c \ucd94\uad6c\ud558\ub294 \uac83\uc774 \uc88b\uc2b5\ub2c8\ub2e4. \uc9c4\uc9dc \uc131\ub2a5 \uc774\uc288\uac00 \uc788\ub294 \uacf3\uc5d0\uc11c\ub9cc \ud574\ub2f9 Hook\uc744 \uc0ac\uc6a9\ud558\uace0, \uadf8 \uc678\uc758 \uacbd\uc6b0\uc5d0\ub294 \ub2e4\ub978 \ucd5c\uc801\ud654 \uae30\ubc95\uc744 \uc801\uc6a9\ud558\ub294 \uac83\uc744 \uace0\ub824\ud574\ubd05\uc2dc\ub2e4."},{"id":"/2023/06/17/useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \uc0ac\uc6a9\uc131 \uac1c\uc120","metadata":{"permalink":"/blog/2023/06/17/useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \uc0ac\uc6a9\uc131 \uac1c\uc120","editUrl":"https://github.com/5kdk/5kdk.github.io/tree/main/blog/2023-06-17-useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \uc0ac\uc6a9\uc131 \uac1c\uc120.md","source":"@site/blog/2023-06-17-useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \uc0ac\uc6a9\uc131 \uac1c\uc120.md","title":"useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \ub4a4\ub85c\uac00\uae30 \uc0ac\uc6a9\uc131 \uac1c\uc120","description":"\uc6d0\ud2f0\ub4dc \ud504\ub9ac\uc628\ubcf4\ub529 \uc0ac\uc804\uacfc\uc81c\ub97c \uc9c4\ud589\ud558\uba70 \uc5ec\ub7ec \ub9ac\ub2e4\uc774\ub809\ud2b8 \uc791\uc5c5\uc774 \ud544\uc694\ud588\uc2b5\ub2c8\ub2e4.","date":"2023-06-17T00:00:00.000Z","formattedDate":"2023\ub144 6\uc6d4 17\uc77c","tags":[{"label":"React","permalink":"/blog/tags/react"},{"label":"React-router","permalink":"/blog/tags/react-router"}],"readingTime":6.01,"hasTruncateMarker":true,"authors":[{"name":"Dongkyu Kim","title":"Collaborative FE developer","url":"https://github.com/5kdk","imageURL":"https://github.com/5kdk.png","key":"5kdk"}],"frontMatter":{"title":"useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \ub4a4\ub85c\uac00\uae30 \uc0ac\uc6a9\uc131 \uac1c\uc120","authors":"5kdk","tags":["React","React-router"],"enableComments":true},"prevItem":{"title":"useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c?","permalink":"/blog/2023/07/04/useMemo, useCallback\uc73c\ub85c \ucd5c\uc801\ud654\uac00 \uaf2d \ud544\uc694\ud560\uae4c"},"nextItem":{"title":"useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30","permalink":"/blog/2022/12/15/useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30"}},"content":"[\uc6d0\ud2f0\ub4dc \ud504\ub9ac\uc628\ubcf4\ub529 \uc0ac\uc804\uacfc\uc81c](https://github.com/5kdk/wanted-pre-onboarding-frontend/tree/main)\ub97c \uc9c4\ud589\ud558\uba70 \uc5ec\ub7ec \ub9ac\ub2e4\uc774\ub809\ud2b8 \uc791\uc5c5\uc774 \ud544\uc694\ud588\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n`Root` \ucef4\ud3ec\ub10c\ud2b8 `/` \uacbd\ub85c \uc811\uadfc\uc2dc `SignIn` \ud398\uc774\uc9c0\ub85c \ub9ac\ub2e4\uc774\ub809\ud2b8\ub97c \ud558\uace0 \uc788\uc5c8\uc73c\uba70 \ub77c\uc6b0\ud305 \uc2dc `SignIn`\uacfc `Todo` \ud398\uc774\uc9c0\ub294 \ub85c\uadf8\uc778 \uc5ec\ubd80\uc5d0 \ub530\ub77c \ub9ac\ub2e4\uc774\ub809\ud2b8 \ucc98\ub9ac\ub97c \ud558\ub294 \ucef4\ud3ec\ub10c\ud2b8 `AuthenticationGuard`\uac00 \uac10\uc2f8\uace0 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n`useNavigate`\ub85c \ub77c\uc6b0\ud305\uc744 \ud560 \ub54c \ub9ac\ub2e4\uc774\ub809\ud2b8 \ub85c\uc9c1\uc73c\ub85c \uc778\ud574 \ub4a4\ub85c\uac00\uae30\uac00 \uc81c\ub300\ub85c \ub418\uc9c0 \uc54a\ub294 \ubb38\uc81c\uac00 \ubc1c\uacac\ub418\uc5c8\uace0, \uc774\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud574 `useNavigate`\ub97c \uc880 \ub354 \uaf3c\uaf3c\ud558\uac8c \uc0b4\ud3b4\ubcf4\uc558\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n## useNavigate \ud1ba\uc544\ubcf4\uae30\\r\\n\\r\\n:::info \uc815\ubcf4\\r\\n\\r\\nReact Router\uc758 `useNavigate` \ud6c5\uc740 React \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \ud504\ub85c\uadf8\ub798\ubc0d \ubc29\uc2dd\uc73c\ub85c \ub77c\uc6b0\ud305\uc744 \uc81c\uc5b4\ud560 \uc218 \uc788\uac8c \ud574\uc8fc\ub294 \ub3c4\uad6c\uc785\ub2c8\ub2e4.\\r\\n\\r\\n`useNavigate`\ub97c \uc0ac\uc6a9\ud558\uba74 URL\uc744 \ubcc0\uacbd\ud558\uac70\ub098 \ud2b9\uc815 \uacbd\ub85c\ub85c \uc774\ub3d9\ud560 \uc218 \uc788\uc73c\uba70, `useNavigate`\ub294 React Router v6\ubd80\ud130 \ub3c4\uc785\ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n:::\\r\\n\\r\\n```jsx\\r\\nimport { useNavigate } from \'react-router-dom\';\\r\\n```\\r\\n\\r\\n`useNavigate` \ud6c5\uc740 \ub77c\uc6b0\ud130 \ucef4\ud3ec\ub10c\ud2b8 \ub0b4\ubd80\uc5d0\uc11c \uc0ac\uc6a9\ub418\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc608\ub97c \ub4e4\uc5b4, \ub2e4\uc74c\uacfc \uac19\uc774 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc815\uc758\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n```jsx\\r\\nimport { useNavigate } from \'react-router-dom\';\\r\\n\\r\\nconst MyComponent = () => {\\r\\n  const navigate = useNavigate();\\r\\n\\r\\n  const handleClick = () => {\\r\\n    navigate(\'/other-route\');\\r\\n  };\\r\\n\\r\\n  return (\\r\\n    <div>\\r\\n      <h1>My Component</h1>\\r\\n      <button onClick={handleClick}>Go to Other Route</button>\\r\\n    </div>\\r\\n  );\\r\\n};\\r\\n```\\r\\n\\r\\n\uc704\uc758 \uc608\uc81c\uc5d0\uc11c `handleClick` \ud568\uc218\uc5d0\uc11c `navigate` \ud568\uc218\ub97c \ud638\ucd9c\ud558\uba74 URL\uc744 \ubcc0\uacbd\ud558\uace0 `/other-route`\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4.\\r\\n\\r\\n`useNavigate`\ub97c \uc0ac\uc6a9\ud558\uc5ec \ub2e4\uc591\ud55c \uc635\uc158\uc744 \uc9c0\uc815\ud560 \uc218\ub3c4 \uc788\uc73c\uba70 \uc774\ub97c \ud1b5\ud574 \ub9ac\ub2e4\uc774\ub809\ud2b8, \uc0c1\ud0dc \ubcc0\uacbd, \ucffc\ub9ac \ub9e4\uac1c\ubcc0\uc218 \uc804\ub2ec \ub4f1 \ub2e4\uc591\ud55c \uc791\uc5c5\uc744 \uc218\ud589\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n```jsx\\r\\nimport { useNavigate } from \'react-router-dom\';\\r\\n\\r\\nconst MyComponent = () => {\\r\\n  const navigate = useNavigate();\\r\\n\\r\\n  const handleClick = () => {\\r\\n    navigate(\'/other-route\', { state: { id: 123 }, replace: true });\\r\\n  };\\r\\n\\r\\n  return (\\r\\n    <div>\\r\\n      <h1>My Component</h1>\\r\\n      <button onClick={handleClick}>Go to Other Route</button>\\r\\n    </div>\\r\\n  );\\r\\n};\\r\\n```\\r\\n\\r\\n\uc704\uc758 \uc608\uc81c\uc5d0\uc11c\ub294 `navigate` \ud568\uc218\uc758 \ub450 \ubc88\uc9f8 \uc778\uc218\ub85c \uac1d\uccb4\ub97c \uc804\ub2ec\ud558\uc5ec \uc635\uc158\uc744 \uc124\uc815\ud560 \uc218 \uc788\ub294\ub370, `state` \ud504\ub85c\ud37c\ud2f0\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc0c1\ud0dc\ub97c \uc804\ub2ec\ud558\uace0, `replace` \ud504\ub85c\ud37c\ud2f0\ub97c `true`\ub85c \uc124\uc815\ud558\uc5ec \uc774\ub3d9\ud55c \ud6c4\uc5d0 \ube0c\ub77c\uc6b0\uc800\uc758 \uae30\ub85d\uc5d0 \ub0a8\uc9c0 \uc54a\ub3c4\ub85d \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n## state\uc640 replace \ud504\ub85c\ud37c\ud2f0\ub97c \ud65c\uc6a9\ud558\uae30\\r\\n\\r\\n### state \ud504\ub85c\ud37c\ud2f0\\r\\n\\r\\n\uac8c\uc2dc\uae00 \ubaa9\ub85d\uc774 \uc788\ub294 \ud398\uc774\uc9c0\uc5d0\uc11c \uc0ac\uc6a9\uc790\uac00 \ud2b9\uc815 \uac8c\uc2dc\uae00\uc744 \ud074\ub9ad\ud558\uba74 \ud574\ub2f9 \uac8c\uc2dc\uae00\uc758 \uc0c1\uc138 \ud398\uc774\uc9c0\ub85c \uc774\ub3d9\ud558\uace0, \uc0c1\uc138 \ud398\uc774\uc9c0\uc5d0\uc11c\ub294 \uac8c\uc2dc\uae00\uc758 ID\uc640 \ud568\uaed8 \ucd94\uac00\uc801\uc778 \ub370\uc774\ud130\ub97c \uc0ac\uc6a9\ud574\uc57c \ud560 \ub54c `state` \ud504\ub85c\ud37c\ud2f0\ub97c \ud65c\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n```jsx\\r\\nimport { useNavigate } from \'react-router-dom\';\\r\\n\\r\\nconst PostList = () => {\\r\\n  const navigate = useNavigate();\\r\\n\\r\\n  const handlePostClick = postId => {\\r\\n    //highlight-start\\r\\n    // \uac8c\uc2dc\uae00 ID\uc640 \ucd94\uac00 \ub370\uc774\ud130\ub97c \ud568\uaed8 \uc804\ub2ec\ud558\uc5ec \uc0c1\uc138 \ud398\uc774\uc9c0\ub85c \uc774\ub3d9\\r\\n    navigate(`/post/${postId}`, {\\r\\n      state: { id: postId, additionalData: \'Some data\' },\\r\\n    });\\r\\n    //highlight-end\\r\\n  };\\r\\n\\r\\n  return (\\r\\n    <div>\\r\\n      <h1>Post List</h1>\\r\\n      <ul>\\r\\n        <li onClick={() => handlePostClick(1)}>Post 1</li>\\r\\n        <li onClick={() => handlePostClick(2)}>Post 2</li>\\r\\n        <li onClick={() => handlePostClick(3)}>Post 3</li>\\r\\n      </ul>\\r\\n    </div>\\r\\n  );\\r\\n};\\r\\n```\\r\\n\\r\\n```jsx\\r\\nimport { useLocation } from \'react-router-dom\';\\r\\n\\r\\nconst PostDetail = () => {\\r\\n  const location = useLocation();\\r\\n  //highlight-start\\r\\n  const { id, additionalData } = location.state;\\r\\n  //highlight-end\\r\\n\\r\\n  return (\\r\\n    <div>\\r\\n      <h1>Post Detail</h1>\\r\\n      <p>ID: {id}</p>\\r\\n      <p>Additional Data: {additionalData}</p>\\r\\n    </div>\\r\\n  );\\r\\n};\\r\\n```\\r\\n\\r\\n### replace \ud504\ub85c\ud37c\ud2f0\\r\\n\\r\\n\ub85c\uadf8\uc778 \ud6c4\uc5d0 \uc0ac\uc6a9\uc790\ub97c \ub85c\uadf8\uc778 \ud398\uc774\uc9c0\ub85c \ub3cc\uc544\uac08 \uc218 \uc5c6\ub3c4\ub85d \ud558\uae30 \uc704\ud574, \ube0c\ub77c\uc6b0\uc800\uc758 \uae30\ub85d\uc5d0\uc11c \uc774\uc804 \ub85c\uadf8\uc778 \ud398\uc774\uc9c0\ub97c \ub300\uccb4\ud558\uba74 \uc0ac\uc6a9\uc790 \uacbd\ud5d8\uc744 \ud5a5\uc0c1 \uc2dc\ud0ac \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n```js\\r\\nconst LoginPage = () => {\\r\\n  const navigate = useNavigate();\\r\\n\\r\\n  const handleLogin = () => {\\r\\n    // \ub85c\uadf8\uc778 \ucc98\ub9ac \ub85c\uc9c1...\\r\\n\\r\\n    // \ub85c\uadf8\uc778 \uc131\uacf5 \ud6c4 \ub300\uc2dc\ubcf4\ub4dc \ud398\uc774\uc9c0\ub85c \uc774\ub3d9 (replace: true \uc635\uc158 \uc0ac\uc6a9)\\r\\n    navigate(\'/dashboard\', { replace: true });\\r\\n  };\\r\\n\\r\\n  return (\\r\\n    <div>\\r\\n      <h1>Login Page</h1>\\r\\n      <button onClick={handleLogin}>Login</button>\\r\\n    </div>\\r\\n  );\\r\\n};\\r\\n```\\r\\n\\r\\n:::tip\\r\\n\\r\\n`Navigate` \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc0ac\uc6a9\ud560\ub54c\ub294 props\uc5d0 `replace`\ub9cc \uc801\uc5b4\uc8fc\uba74 \ub429\ub2c8\ub2e4.\\r\\n\\r\\n:::\\r\\n\\r\\n## \uacb0\ub860\\r\\n\\r\\n\uc774\uc640 \uac19\uc774 `useNavigate`\ub97c \uc0ac\uc6a9\ud558\uc5ec React \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \ud504\ub85c\uadf8\ub798\ubc0d \ubc29\uc2dd\uc73c\ub85c \ub77c\uc6b0\ud305\uc744 \uc81c\uc5b4\ud560 \uc218 \uc788\uc73c\uba70 `useNavigate`\uc758 \ub2e4\uc591\ud55c \uc635\uc158\uc744 \ud65c\uc6a9\ud558\uba74 \ub354\uc6b1 \uc720\uc5f0\ud558\uace0 \ud48d\ubd80\ud55c \uc0ac\uc6a9\uc790 \uacbd\ud5d8\uc744 \uc81c\uacf5\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n\uc800\uc758 \uacbd\uc6b0 \uacb0\uad6d \ub9ac\ub2e4\uc774\ub809\ud2b8\uc2dc `{ replace: true }` \uc635\uc158\uc744 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uc544 \uacc4\uc18d\ub418\ub294 \ub9ac\ub2e4\uc774\ub809\ud2b8 \ubb38\uc81c\uac00 \uc0dd\uacbc\uace0 \uc774\ub97c \ud574\ub2f9 \uc635\uc158\uc744 \ud1b5\ud574 \uc190\uc27d\uac8c \ud574\uacb0\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n`useNavigate`, `Navigate`(useNavigate\ub97c \ub458\ub7ec\uc2fc \ucef4\ud3ec\ub10c\ud2b8 \ub798\ud37c)\ub294 `replace` \ud504\ub85c\ud37c\ud2f0\ub97c \uc0ac\uc6a9\ud558\uc5ec \ube0c\ub77c\uc6b0\uc800\uc758 \uae30\ub85d\uc5d0 \uc0c8\ub85c\uc6b4 \ud56d\ubaa9\uc744 \ucd94\uac00\ud558\uc9c0 \uc54a\uace0 \uc774\uc804 \ud56d\ubaa9\uc744 \ub300\uccb4\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n\ub85c\uadf8\uc778 \ub610\ub294 \uc778\uc99d\uacfc \uad00\ub828\ub41c \uacbd\ub85c \uc804\ud658\uacfc \uac19\uc774 \uc774\uc804 \ud398\uc774\uc9c0\ub85c \ub3cc\uc544\uac00\uc9c0 \uc54a\uc544\uc57c \ud558\ub294 \uc0c1\ud669\uc5d0\uc11c `replace` \ud504\ub85c\ud37c\ud2f0\ub97c \uc798 \ud65c\uc6a9\ud569\uc2dc\ub2e4.\\r\\n\\r\\n> https://reactrouter.com/en/main/hooks/use-navigate  \\r\\n> https://reactrouter.com/en/main/components/navigate"},{"id":"/2022/12/15/useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30","metadata":{"permalink":"/blog/2022/12/15/useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30","editUrl":"https://github.com/5kdk/5kdk.github.io/tree/main/blog/2022-12-15-useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30.md","source":"@site/blog/2022-12-15-useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30.md","title":"useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30","description":"useCallback\uc740 \ud568\uc218\ub97c \uba54\ubaa8\uc774\uc81c\uc774\uc158(memoization)\ud558\uae30 \uc704\ud574\uc11c \uc0ac\uc6a9\ub418\ub294 Hook\ub4e4 \uc785\ub2c8\ub2e4. React\uc758 useCallback\uc744 useEffect\uc640 \ud568\uaed8 \uc0ac\uc6a9\ud558\uc5ec \uc5ec\ub7ec\ubc29\uba74\uc73c\ub85c \ud6a8\uc728\uc801\uc778 \ucf54\ub4dc\ub97c \uad6c\uc131\ud560 \uc218 \uc788\ub294 \ubc29\ubc95\uc774 \uc788\uc2b5\ub2c8\ub2e4. useCallback\uc740 useEffect\uc640 \uc0dd\uae34 \uac83\uc740 \ub611\uac19\uc9c0\ub9cc, \uc5ed\ud560\uc740 \uc870\uae08 \ub2e4\ub985\ub2c8\ub2e4.","date":"2022-12-15T00:00:00.000Z","formattedDate":"2022\ub144 12\uc6d4 15\uc77c","tags":[{"label":"React","permalink":"/blog/tags/react"}],"readingTime":4.115,"hasTruncateMarker":true,"authors":[{"name":"Dongkyu Kim","title":"Collaborative FE developer","url":"https://github.com/5kdk","imageURL":"https://github.com/5kdk.png","key":"5kdk"}],"frontMatter":{"title":"useCallback\uc73c\ub85c useEffect \uc2ec\ud654 \ud65c\uc6a9 \ud574\ubcf4\uae30","authors":"5kdk","tags":["React"],"enableComments":true},"prevItem":{"title":"useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \ub4a4\ub85c\uac00\uae30 \uc0ac\uc6a9\uc131 \uac1c\uc120","permalink":"/blog/2023/06/17/useNavigate\uc758 \uc635\uc158\uc744 \ud65c\uc6a9\ud55c \uc0ac\uc6a9\uc131 \uac1c\uc120"}},"content":"[`useCallback`](https://react.dev/reference/react/useCallback)\uc740 \ud568\uc218\ub97c \uba54\ubaa8\uc774\uc81c\uc774\uc158(memoization)\ud558\uae30 \uc704\ud574\uc11c \uc0ac\uc6a9\ub418\ub294 Hook\ub4e4 \uc785\ub2c8\ub2e4. React\uc758 `useCallback`\uc744 [`useEffect`](https://react.dev/reference/react/useEffect)\uc640 \ud568\uaed8 \uc0ac\uc6a9\ud558\uc5ec \uc5ec\ub7ec\ubc29\uba74\uc73c\ub85c \ud6a8\uc728\uc801\uc778 \ucf54\ub4dc\ub97c \uad6c\uc131\ud560 \uc218 \uc788\ub294 \ubc29\ubc95\uc774 \uc788\uc2b5\ub2c8\ub2e4. `useCallback`\uc740 `useEffect`\uc640 \uc0dd\uae34 \uac83\uc740 \ub611\uac19\uc9c0\ub9cc, \uc5ed\ud560\uc740 \uc870\uae08 \ub2e4\ub985\ub2c8\ub2e4.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n## \uc608\uc81c\ub85c \ubcf4\ub294 useEffect\xa0\uc2ec\ud654\xa0\ud65c\uc6a9\\r\\n\\r\\n```jsx\\r\\nconst memoizedCallback = useCallback(() => {\\r\\n  doSomething(a, b);\\r\\n}, [a, b]);\\r\\n```\\r\\n\\r\\n`useCallback`\uc744 \uc0b4\ud3b4\ubcf4\uc790\uba74 \uccab \ubc88\uc9f8 \uc778\uc790\ub85c \ucf5c\ubc31\ud568\uc218\ub97c \ub123\uc5b4\uc8fc\uace0, \ub450 \ubc88\uc9f8\ub85c \uc778\uc790\ub85c \uc758\uc874\uc131 \ubc30\uc5f4\uc744 \ub123\uc5b4\uc90d\ub2c8\ub2e4. `a`\ub098 `b`\uac00 \ubc14\ub00c\uc5c8\uc744 \ub54c\ub9cc `useCallback`\uc758 \ucf5c\ubc31 \ud568\uc218\ub97c \uc0c8\ub85c \uc0dd\uc131\ud558\uace0, \uadf8\ub807\uc9c0 \uc54a\uc744 \uacbd\uc6b0 \ucf5c\ubc31 \ud568\uc218\ub97c \uc0dd\uc131\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n### useCallback\uc744 useEffect\uc640 \ud568\uaed8 \uc0ac\uc6a9\ud558\ub294 \uc608\\r\\n\\r\\n```jsx\\r\\nconst memoizedCallback = useCallback(() => {\\r\\n  doSomething(a, b);\\r\\n  // highlight-start\\r\\n}, [a, b]);\\r\\n// highlight-end\\r\\n\\r\\n// highlight-start\\r\\nuseEffect(() => {\\r\\n  memoizedCallback();\\r\\n}, [memoizedCallback]);\\r\\n// highlight-end\\r\\n```\\r\\n\\r\\n`useEffect`\uc758 \uc758\uc874\uc131 \ubc30\uc5f4\uc5d0 `memoizedCallback`\uc774 \uc788\uace0, \ucf5c\ubc31\ud568\uc218\uc5d0\uc11c `memoizedCallback`\uc744 \ud638\ucd9c\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n`memoizedCallback`\ub294 `a`, `b`\uc5d0 \uc758\uc874\uc801\uc774\ubbc0\ub85c, `a`\uc640 `b`\uac00 \ubcc0\uacbd\uc774 \uc0dd\uacbc\uc744 \ub54c\ub9cc \uc0dd\uc131\ub420 \uac83\uc774\uace0, `useEffect`\ub294 `memoizedCallback`\uc774 \uc0c8\ub85c \uc0dd\uc131\ub418\uc5c8\uc744 \ub54c `memoizedCallback`\uc744 \ud638\ucd9c\ud560 \uac83\uc785\ub2c8\ub2e4.\\r\\n\\r\\n```jsx\\r\\nuseEffect(() => {\\r\\n  doSomething(a, b);\\r\\n}, [a, b]);\\r\\n```\\r\\n\\r\\n## \uc5ec\uae30\uc11c useCallback\uc740 \uc65c \uc0ac\uc6a9\ud560\uae4c?\\r\\n\\r\\n\uc0ac\uc2e4, \uc704 \ucf54\ub4dc\ub294 \uc55e\uc11c\ubcf8 \ucf54\ub4dc\uc640 \uac19\uc740 \ud615\ud0dc\ub97c \ub760\uac8c \ub429\ub2c8\ub2e4. \ud6e8\uc52c \uac04\ub2e8\ud574 \ubcf4\uc785\ub2c8\ub2e4. \uadf8\ub807\ub2e4\uba74 \uc65c `useCallback`\uc744 \uc0ac\uc6a9\ud560\uae4c\uc694?\\r\\n\\r\\n:::caution \ubb38\uc81c\uc810\\r\\n\\r\\n- useEffect\uc5d0\uc11c \ud558\ub294 \ud589\ub3d9\uc774 \ub9ce\uc544\uc9c8\uc218\ub85d \ucf54\ub4dc\uac00 \ubcf5\uc7a1\ud574\uc9d1\ub2c8\ub2e4.\\r\\n- dependency array\uac00 \uae38\uc5b4 \uc9c8 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n- \ucd94\ud6c4\uc5d0 \uc720\uc9c0\ubcf4\uc218\ub97c \ud558\ub824\ud558\uba74 \ud5f7\uac08\ub9ac\uac8c \ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n:::\\r\\n\\r\\n:::info \ud574\uacb0\ubc29\uc548\\r\\n\\r\\n- `useEffect`\ub294 \uc6b0\ub9ac\uac00 \uc6d0\ud558\ub294 side effect\ub97c \uc2e4\ud589\ub9cc \ud574\uc8fc\uace0,  \\r\\n  `useCallback`\uc5d0\uc11c \uc2e4\uc81c \ud574\uc57c \ud558\ub294 \uac83\ub4e4\uc744 \uc120\uc5b8\ud574\uc8fc\uba74 \ucf54\ub4dc\uc758 \ubd84\ub9ac\uac00 \uac00\ub2a5\ud569\ub2c8\ub2e4.\\r\\n- \ucf5c\ubc31 \ud568\uc218\uc758 \uad6c\uccb4\uc801\uc778 \uc5ed\ud560\uc744 \uc774\ub984\uc744 \ud1b5\ud574 \uba85\uc2dc\uc801\uc73c\ub85c \ud655\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n- \ucf54\ub4dc\ub97c \uc815\ub9ac\ud558\uace0 \uac00\ub3c5\uc131\uc744 \ub192\uc5ec\uc11c \uc720\uc9c0\ubcf4\uc218\ub97c \uc218\uc6d4\ud558\uac8c \ud574 \uc904 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n:::\\r\\n\\r\\n### state\uac00 \ubc14\ub014 \ub54c\ub9c8\ub2e4 \ub370\uc774\ud130\ub97c \ubc1b\uc544\uc640\uc57c \ud558\ub294 \uacbd\uc6b0\\r\\n\\r\\n#### 1. useEffect\ub9cc \uc0ac\uc6a9\ud558\ub294 \uc608\\r\\n\\r\\n```jsx\\r\\nuseEffect(() => {\\r\\n  const getDate = async () => {\\r\\n    const response = await fetch(\'some url\');\\r\\n    setData(response.data);\\r\\n  };\\r\\n  getData();\\r\\n}, [someDeps]);\\r\\n```\\r\\n\\r\\n`useEffect`\uc758 \ucf5c\ubc31\ud568\uc218\ub294 [Promise](https://developer.mozilla.org/ko/docs/Web/JavaScript/Reference/Global_Objects/Promise)\ub97c \ubc18\ud658\ud558\ub294 \ube44\ub3d9\uae30 \ud568\uc218\uac00 \ub420 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4. \ub54c\ubb38\uc5d0, `getData`\ub77c\ub294 \ube44\ub3d9\uae30 \ud568\uc218\ub97c `useEffect`\uac00 \uc2e4\ud589\ub420 \ub54c\ub9c8\ub2e4 \uc0dd\uc131\ud574\uc8fc\uace0, \uadf8 \uc548\uc5d0\uc11c \ub370\uc774\ud130\ub97c \uac00\uc838\uc624\uace0 `setData`\ub97c \ud574\uc8fc\uac8c \ub429\ub2c8\ub2e4. \uadf8\ub9ac\uace0 \ub9cc\ub4e0 `getData`\ub77c\ub294 \ud568\uc218\ub97c \uc2e4\ud589\ud558\uac8c \ub429\ub2c8\ub2e4. `useEffect`\uac00 \uc2e4\ud589\ub420 \ub54c\ub9c8\ub2e4 \ub9e4\ubc88 \ud568\uc218\uac00 \uc0dd\uc131\ub418\uace0 \uc2e4\ud589\ub418\ub2c8 \ub9e4\uc6b0 \ube44\ud6a8\uc728\uc801\uc785\ub2c8\ub2e4.\\r\\n\\r\\n#### 2. useEffect + useCallback \uc870\ud569\ud55c \uc608\\r\\n\\r\\n```jsx\\r\\nconst getData = useCallback(async () => {\\r\\n  const response = await fetch(\'some url\');\\r\\n  setData(response.data);\\r\\n}, [someDeps]);\\r\\n\\r\\nuseEffect(() => {\\r\\n  getData();\\r\\n}, [getData]);\\r\\n```\\r\\n\\r\\n## \uacb0\ub860\\r\\n\\r\\n`useCallback`\uc744 \ud65c\uc6a9\ud558\uba74, `useCallback`\uc548\uc5d0\uc11c \ub370\uc774\ud130\ub97c \uac00\uc838\uc624\ub294 \ucf5c\ubc31 \ud568\uc218\ub97c `getData`\uc5d0 \ub123\uc5b4\uc8fc\uace0, `useEffect`\uc548\uc5d0\uc11c\ub294 `getData`\ub9cc \ud638\ucd9c\uc744 \ud574\uc8fc\uba74 \ucf54\ub4dc\uac00 \ud6e8\uc52c \uae54\ub054\ud574\uc9c0\uace0, \ub85c\uc9c1\ub3c4 \ubd84\ub9ac\ub418\uba70 \uac00\ub3c5\uc131\uc774 \uc62c\ub77c\uac00\ub294 \ud6a8\uacfc\ub97c \uc5bb\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4."}]}')}}]);